public MultipartStream(
        InputStream input, byte[] boundary, int bufSize, ProgressNotifier pNotifier) {

    if (boundary == null) {
        throw new IllegalArgumentException("boundary may not be null");
    }
    this.boundaryLength = boundary.length + BOUNDARY_PREFIX.length;
    if (bufSize < this.boundaryLength + 1) {
        throw new IllegalArgumentException(
                "The buffer size specified for the MultipartStream is too small");
    }

    this.input = input;
    this.bufSize = Math.max(bufSize, boundaryLength * 2);
    this.buffer = new byte[this.bufSize];
    this.notifier = pNotifier;

    this.boundary = new byte[this.boundaryLength];
    this.boundaryTable = new int[this.boundaryLength + 1];
    this.keepRegion = this.boundary.length;

    System.arraycopy(BOUNDARY_PREFIX, 0, this.boundary, 0, BOUNDARY_PREFIX.length);
    System.arraycopy(boundary, 0, this.boundary, BOUNDARY_PREFIX.length, boundary.length);
    computeBoundaryTable();

    head = 0;
    tail = 0;
}

private void computeBoundaryTable() {
    int position = 2;
    int candidate = 0;

    boundaryTable[0] = -1;
    boundaryTable[1] = 0;

    while (position <= boundaryLength) {
        if (boundary[position - 1] == boundary[candidate]) {
            boundaryTable[position] = candidate + 1;
            candidate++;
            position++;
        } else if (candidate > 0) {
            candidate = boundaryTable[candidate];
        } else {
            boundaryTable[position] = 0;
            position++;
        }
    }
}

public long skip(long bytes) throws IOException {
    if (closed) {
        throw new FileItemStream.ItemSkippedException();
    }
    int av = available();
    if (av == 0) {
        av = makeAvailable();
        if (av == 0) {
            return 0;
        }
    }
    long res = Math.min(av, bytes);
    head += res;
    return res;
}

public int read() throws IOException {
    return read0();
}

public int available() throws IOException {
    if (pos == -1) {
        return tail - head - pad;
    }
    return pos - head;
}

public void close1(boolean pCloseUnderlying) throws IOException {
    if (closed) {
        return;
    }
    if (pCloseUnderlying) {
        closed = true;
        input.close();
    } else {
        for (; ; ) {
            int av = available();
            if (av == 0) {
                av = makeAvailable();
                if (av == 0) {
                    break;
                }
            }
            skip(av);
        }
    }
    closed = true;
}

public void close0() throws IOException {
    close1(false);
}

public int read1(byte[] b, int off, int len) throws IOException {
    if (closed) {
        throw new FileItemStream.ItemSkippedException();
    }
    if (len == 0) {
        return 0;
    }
    int res = available();
    if (res == 0) {
        res = makeAvailable();
        if (res == 0) {
            return -1;
        }
    }
    res = Math.min(res, len);
    System.arraycopy(buffer, head, b, off, res);
    head += res;
    total += res;
    return res;
}

public int read0() throws IOException {
    if (closed) {
        throw new FileItemStream.ItemSkippedException();
    }
    if (available() == 0 && makeAvailable() == 0) {
        return -1;
    }
    ++total;
    int b = buffer[head++];
    if (b >= 0) {
        return b;
    }
    return b + BYTE_POSITIVE_OFFSET;
}

private int makeAvailable() throws IOException {
    if (pos != -1) {
        return 0;
    }

    total += tail - head - pad;
    System.arraycopy(buffer, tail - pad, buffer, 0, pad);

    head = 0;
    tail = pad;

    for (; ; ) {
        int bytesRead = input.read(buffer, tail, bufSize - tail);
        if (bytesRead == -1) {
            final String msg = "Stream ended unexpectedly";
            throw new MalformedStreamException(msg);
        }
        if (notifier != null) {
            notifier.noteBytesRead(bytesRead);
        }
        tail += bytesRead;

        findSeparator();
        int av = available();

        if (av > 0 || pos != -1) {
            return av;
        }
    }
}

private void findSeparator() {
    pos = MultipartStream.this.findSeparator();
    if (pos == -1) {
        if (tail - head > keepRegion) {
            pad = keepRegion;
        } else {
            pad = tail - head;
        }
    }
}

private void notifyListener() {
    if (listener != null) {
        listener.update(bytesRead, contentLength, items);
    }
}

void noteBytesRead(int pBytes) {
    /* Indicates, that the given number of bytes have been read from
     * the input stream.
     */
    bytesRead += pBytes;
    notifyListener();
}

ProgressNotifier(ProgressListener pListener, long pContentLength) {
    listener = pListener;
    contentLength = pContentLength;
}
